export default function Calendar() {

    const currMonth = "January"
    const currYear = "2026"

    let table;
    for (let week_id = 0; week_id <= 4; week_id++) {
        table.push(
            <tr>
                {[1,2,3,4,5,6,7].map(col => {
                    let day_id = week_id*7 + col;
                    return (
                        <td 
                            id={day_id}
                            key={day_id}>
                            #{day_id}
                            <ul>
                                <li>Today is the {day_id} day of the month.</li>
                            </ul>
                        </td>
                    );
                })}
            </tr>
        );

    }

    return (
        <>
            <table>
                <thead>
                    <tr>{currMonth + " " + currYear}</tr>
                    <tr>
                        <th>Sun</th>
                        <th>Mon</th>
                        <th>Tue</th>
                        <th>Wed</th>
                        <th>Thu</th>
                        <th>Fri</th>
                        <th>Sat</th>
                    </tr>
                </thead>
                <tbody>
                    {table}
                </tbody>
            </table>
        </>
    );
}
